import {useState,useEffect} from 'react';
let memeslink=[];
const Memes=()=>{
    let [memeslink,setMemeslink]=useState([]);
    useEffect(()=>{
        fetch("http://alpha-meme-maker.herokuapp.com/1",{mode:"no-cors"}).then((res)=>{
            console.log(res.json);
        });
    },memeslink);
    return (
        <div>
            {
                memeslink.map((x)=>{
                    return <div> <img src={x} alt="Loading"/> </div>
                })
            }
        </div>
    )
}
export default Memes;
